import { HorariosCard } from "./style";
import React, { useState, useEffect } from 'react';
import api from './../../services/api';

export default function Horarios(props: any) {
  const [token] = useState(localStorage.getItem('token'));
  const [user, setUser] = useState([]);
  const dia: any[]= props.data.split("/");

  useEffect(() => {
    api
    .post("/horarios-marcados",{
      dia:dia[0],
      mes:dia[1],
      ano:dia[2]
    })
    .then((response) => setUser(response.data))
    .catch((err) => {
      console.error("ops! ocorreu um erro" + err);
    });
  }, [props.data]);

  let horariosDisponivel:any = [];

  user.forEach((element: any) => {
    horariosDisponivel.push(
      <div className="horario-disponivel" >
        {element.horario_inicio}
      </div>
    )
  });

  let listaHorarios: any = [];

return (
  <HorariosCard >

<input type="radio" id="html" name="fav_language" value="HTML" />
<label for="html" >HTML</label>

      {props.data}
      {listaHorarios}
      {horariosDisponivel}
    </HorariosCard>
  );
}
